import React from "react"

function Question(props) {
    var data = props.data
    var correct = props.correct_answer
    var incorrect = props.incorrect_answer
    return (
        <div>
            <h1>Question {props.id + 1}</h1>
            <h3>{JSON.stringify(data.question)}</h3>
            <p>{correct}{incorrect}</p>
        </div>
    )
}

export default Question;
